import React from "react";
import { useTranslation } from "react-i18next";
import ItemList from "./components/";

export const MyComponent = () => {
  const { t } = useTranslation();

  const items = [
    { id: Math.random().toString(), title: t("items.0.Lunch"), description: " ", price: " ", category: t("items.0.category"), imgUrl: "1.png" },
    { id: Math.random().toString(), title: " ", description: " ", price: " ", category: "", imgUrl: "2.png" },
    { id: Math.random().toString(), title: " ", description: " ", price: " ", category: "", imgUrl: "3.png" },
    { id: Math.random().toString(), title: "  ", description: " ", price: " ", category: "", imgUrl: "2.png" },
    { id: Math.random().toString(), title: "", description: " ", price: " ", category: "", imgUrl: "1.png" },
    { id: Math.random().toString(), title: "", description: " ", price: " ", category: "", imgUrl: "3.png" },
    { id: Math.random().toString(), title: " ", description: " ", price: " ", category: "", imgUrl: "3.png" }
  ];

  // أي كود إضافي هنا

  return <ItemList itemsData={items} />;
};

export default MyComponent;
